/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[9];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(conv2d_s(&conv1d_config), layer[0]);
	layer[2] = model.hook(rnn_s(lstm_cell_s(&lstm_lstm_cell_config), &lstm_config), layer[1]);
	layer[3] = model.hook(rnn_s(lstm_cell_s(&lstm_1_lstm_cell_config), &lstm_1_config), layer[2]);
	layer[4] = model.hook(flatten_s(&flatten_config), layer[3]);
	layer[5] = model.hook(dense_s(&dense_config), layer[4]);
	layer[6] = model.hook(dense_s(&dense_1_config), layer[5]);
	layer[7] = model.hook(softmax_s(&softmax_config), layer[6]);
	layer[8] = model.hook(output_s(&output_config), layer[7]);
	model_compile(&model, layer[0], layer[8]);
	return &model;
}
